function getProfileData(t){return new Promise((a,n)=>{$.getJSON("data/profiles.json",n=>{a(n[t])})})}async function initiateProfile(t){let a=await getProfileData(t);await $(".card-header").text(a.name),$(".trn-name").text(a.name),$(".trn-studies").text(a.studies),$(".trn-stage").text(a.stage)}async function initiateTrainees(){for(let t=0;t<10;t++){let a=await $($("#profileCardTemplate").html());await $(".trn-name",a).text("Trainee Nr. "+(t+1)),await $(".profile-card",a).attr("data-profileid","trn"+t),await $(".trow-1").append(a)}}!function(t){t(document).on("click","#nav-link-trainees",async function(){await t("#page-content").load("sections/trainees.html",async()=>{await initiateTrainees()})}),t(document).on("click","#nav-link-quiz",async function(){await t("#page-content").load("sections/quiz.html",async()=>{await t.getScript("/js/quiz.js")})}),t(".nav-link:not([id])").click(function(){t("#page-content").load("sections/blank.html")}),t(document).on("click",".profile-card",async function(){await t("#page-content").load("sections/profile.html",async()=>{initiateProfile(t(this).data("profileid"))})})}(jQuery);